import React, { Component } from 'react'
import { Layout, Card } from 'antd';
export default class login extends Component {
    render() {
        return (
            <Layout
                style={{
                    height: '100vh',
                    justifyContent: 'center',
                    alignItems: 'center'
                }}>
                <Card style={{ width: 400 }}>
                <Input placeholder="Basic usage" />
                </Card>
            </Layout>
        )
    }
}
